                var user = users[index];
                try
                {
                    var id = int.Parse(user);

                    var existingUser = await _databaseContext.Users.FindAsync(id);
                    if (existingUser is null)
                    {
                        var osuUser = await _osuApiDataService.GetUser(id);
                        await Task.Delay(1000);
                        if (osuUser == null)
                        {
                            continue;
                        }

                        var newUser = _mapper.Map<OsuUser, User>(osuUser);
                        newUser.CreatedAt = DateTime.UtcNow;

                        await _databaseContext.Users.AddAsync(newUser);

                        added++;
                    }
                    else
                    {
                        var hasRelations = await _databaseContext.Relations.AnyAsync(x => x.FromId == id);
                        if (!hasRelations && existingUser.FollowerCount <= 0)
                        {
                            var osuUser = await _osuApiDataService.GetUser(id);
                            await Task.Delay(1000);
                            if (osuUser == null)
                            {
                                continue;
                            }

                            existingUser.Username = osuUser.Username;
                            existingUser.CountryCode = osuUser.CountryCode;
                            existingUser.FollowerCount = osuUser.FollowerCount;
                            existingUser.Title = osuUser.Title;
                            existingUser.Rank = osuUser.Statistics?.GlobalRank;
                            existingUser.UpdatedAt = DateTime.UtcNow;

                            _databaseContext.Users.Update(existingUser);

                            added++;
                        }
                    }

                    if (added > 100)
                    {
                        _logger.Log(LogLevel.Information, $"Populate job: saving 100 ({index}/{users.Length}) users...");
                        await _databaseContext.SaveChangesAsync();

                        added = 0;
                    }
                }
                catch (Exception e)
                {
                    _logger.Log(LogLevel.Error, e, "Populate job: exception {e}!", e.ToString());
                }
            }

            _logger.Log(LogLevel.Information, $"Populate job: saving remainder...");
            await _databaseContext.SaveChangesAsync();

            _logger.Log(LogLevel.Information, "Populate job: finished!");
